description:
Классический вкус колы освежает и заряжает отличным настроением на весь день. 
В максимально вкусный состав входят:
· специально подготовленная артезианская вода для максимального освежения;
· карамельный колер для насыщенного и благородного цвета;
· углекислый газ для пузырьков и "колючего" вкуса;
· натуральный сахар для приятной сладости и долгого послевкусия;
· кофеин для бодрости и энергии;
· наша собственная авторская композиция натуральных ароматизаторов, которая ярче раскрывает вкус и аромат.
